import React from 'react'
import { Link } from 'react-router-dom'
import { slide as Menu } from 'react-burger-menu'


class Header extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      sidebarOpen: true
    };
    this.onSetSidebarOpen = this.onSetSidebarOpen.bind(this);
  }

  onSetSidebarOpen(open) {
    this.setState({ sidebarOpen: open });
  }

  render() {
    return (
      <Menu>
        <a id="home" className="menu-item" href="/">Home</a>
        <a id="entity designer" className="menu-item" href="/EntityDesigner">About</a>
        <a id="form designer" className="menu-item" href="/FormDesigner">Contact</a>
        <a id="workflow designer" className="menu-item" href="/WorkflowDesigner">Contact</a>

      </Menu>
    );
  }
}

export default Header
